class Solution(object):
    def numberOfGoodSubarraySplits(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        ones = sum(nums)
        if ones == 0:
            return 0
        count_ones, ans = 0, 0
        for num in nums[:-1]:  # Exclude the last element to ensure subarrays are non-empty
            if num == 1:
                count_ones += 1
            if count_ones == 1:
                ans += 1
            elif count_ones == ones:
                break
            elif count_ones > 1:
                ans -= 1
        return ans
